import React from 'react';
import PieChart from './PieChart';
import ReligionPieChart from './ReligionPieChart';
import CastePieChart from './CastePieChart';
import { Card, CardContent, Typography, Grid } from '@mui/material';
import { makeStyles } from '@mui/styles'; // Updated import

const useStyles = makeStyles((theme) => ({
  card: {
    marginBottom: theme.spacing(2), // Add spacing between cards
    border: '1px solid #e0e0e0', // Add a border to the cards
    borderRadius: '8px', // Add border radius
  },
  cardContent: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    padding: theme.spacing(2),
  },
}));

const ChartsCard = () => {
  const classes = useStyles();

  return (
    <div>
      <Card className={classes.card}>
        <CardContent className={classes.cardContent}>
          <Typography variant="h6" gutterBottom>
            Dropout Pie Chart
          </Typography>
          <PieChart />
        </CardContent>
      </Card>

      <Card className={classes.card}>
        <CardContent className={classes.cardContent}>
          <Typography variant="h6" gutterBottom>
            Religion Pie Chart
          </Typography>
          <ReligionPieChart />
        </CardContent>
      </Card>

      <Card className={classes.card}>
        <CardContent className={classes.cardContent}>
          <Typography variant="h6" gutterBottom>
            Caste Pie Chart
          </Typography>
          <CastePieChart />
        </CardContent>
      </Card>
    </div>
  );
}

export default ChartsCard;
